    "summary": "Protein Packed Carrot Muffins might be just the morn meal you are searching for. Watching your figure? This gluten free and fodmap friendly recipe has <b>421 calories</b>, <b>19g of protein</b>, and <b>31g of fat</b> per serving. For <b>$1.63 per serving</b>, this recipe <b>covers 26%</b> of your daily requirements of vitamins and minerals. 20 people have made this recipe and would make it again. If you have walnut pieces, eggs, whey powder, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes approximately <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 89%</b>. This score is super. Try <a href=\"https://spoonacular.com/recipes/protein-packed-microwave-muffins-622261\">Protein Packed Microwave Muffins</a>, <a href=\"https://spoonacular.com/recipes/carrot-cake-protein-muffins-720422\">Carrot Cake Protein Muffins</a>, and <a href=\"https://spoonacular.com/recipes/protein-packed-pizza-248207\">Protein Packed Pizza</a> for similar recipes.",
