    "occasions": [ ],
    "instructions": "<ol><li>Slice the chicken breast down the middle to form a pocket in the chicken. Add in your cheese slices and ham.</li><li>Close chicken up with either toothpicks or kitchen twine.</li><li>Mix together the panko and the tarragon. Roll the breasts in the mixture.</li><li>Heat a large pan on medium high heat and add in the oil. When the oil is heated, add in your breasts and cook for a minute or two on each side.</li><li>Place breasts in an oven preheated to 350 degrees and cook for 25-30 minutes or until juices run clear.</li><li>While chicken is cooking, grab up a large saute pan, add the butter and melt it on medium heat.</li><li>Add in the mushrooms and cook for a minute or two.</li><li>Add in the garlic, onion, tarragon, and salt and cook for an additional 2 to 3 minutes.</li><li>Add in the flour and stir to coat.</li><li>Add in the wine and chicken broth and allow the sauce to heat back up and thicken.</li><li>Once thickened, remove from heat and stir in the half & half and fresh parsley. Add additional salt if needed.</li><li>Pour over cordon bleu and serve.</li></ol>",
