    "imageType": "png",
    "summary": "You can never have too many side dish recipes, so give Smashed Fried Lemon Potatoes a try. This recipe makes 4 servings with <b>199 calories</b>, <b>4g of protein</b>, and <b>7g of fat</b> each. For <b>$1.16 per serving</b>, this recipe <b>covers 10%</b> of your daily requirements of vitamins and minerals. 6 people have tried and liked this recipe. If you have lemon zest, sea salt, olive oil, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes about <b>45 minutes</b>. It is a good option if you're following a <b>gluten free, whole 30, and vegan</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 78%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/fried-smashed-potatoes-with-onions-and-meyer-lemon-dressing-538966\">Fried Smashed Potatoes with Onions and Meyer Lemon Dressing</a>, <a href=\"https://spoonacular.com/recipes/fried-smashed-potatoes-640341\">Fried Smashed Potatoes</a>, and <a href=\"https://spoonacular.com/recipes/fried-smashed-potatoes-with-lemons-300266\">Fried Smashed Potatoes with Lemons</a> for similar recipes.",
