    "instructions": "<ol><li>1. Cook chicken breasts (I sauteed mine with a little olive oil and salt and pepper) and set aside. Cook pasta while cooking the chicken and set aside.</li><li>2. In a sauce pan, melt butter. Add flour and stir in with butter, cook for 1 minute. Whisk in milk, salt and pepper, garlic powder, lemon juice, and wine. Bring to a boil, constantly whisking. Reduce the heat and simmer for about 5 more minutes. Sauce should thicken.</li><li>3. In a large saute pan, add pasta, chicken, and any other desired additions. Heat pan on medium heat. Add alfredo sauce and toss with pasta. Sprinkle with Parmesan cheese and additional salt and pepper (if needed) and serve!</li><li>Notes: This recipe made more sauce than I really needed, but I liked having extra. This way, you can add as much sauce as you prefer!</li></ol>",
