    "summary": "The recipe Chocolate and Szechuan Peppercorn Brownies could satisfy your American craving in about <b>45 minutes</b>. This recipe makes 16 servings with <b>305 calories</b>, <b>5g of protein</b>, and <b>15g of fat</b> each. For <b>47 cents per serving</b>, this recipe <b>covers 8%</b> of your daily requirements of vitamins and minerals. 24 people were impressed by this recipe. A mixture of flour, espresso, milk, and a handful of other ingredients are all it takes to make this recipe so flavorful. All things considered, we decided this recipe <b>deserves a spoonacular score of 34%</b>. This score is rather bad. Similar recipes include <a href=\"https://spoonacular.com/recipes/hersheys-ultimate-chocolate-brownies-chocolate-frosted-brownies-564611\">Hershey’s Ultimate Chocolate Brownies | Chocolate Frosted Brownies</a>, <a href=\"https://spoonacular.com/recipes/sweet-salty-brownies-dark-chocolate-fudge-brownies-with-dulce-de-leche-583948\">Sweet & Salty Brownies: Dark Chocolate Fudge Brownies with Dulce De Leche</a>, and <a href=\"https://spoonacular.com/recipes/one-pan-brownies-triple-chocolate-fudge-brownies-260095\">One Pan Brownies (Triple-Chocolate Fudge Brownies)</a>.",
