    "instructions": "<ol><li>Preheat oven to 350.</li><li>Grease an 8x8 baking dish.</li><li>In a large saut pan over medium heat, melt the butter and add the peppercorns and the pieces of cinnamon stick.</li><li>Meanwhile, in a double boiler or microwave, melt the unsweetened chocolate and semisweet chocolate together.</li><li>Stir in the espresso to the melted chocolate.</li><li>Once the butter stops foaming and you can see browned bits at the bottom of the pan (about 5 minutes), take off heat and remove the peppercorns and cinnamon stick.</li><li>It may be easier to strain the contents of the pan and then return just the butter to it.</li><li>Stir the sugars, milk, vanilla, and salt into the butter in the pan.</li><li>Then stir in the cocoa powder and chocolate and espresso mixture.</li><li>Beat in the eggs, and then lastly, stir in the flour.</li><li>Bake in greased pan for about 25-30 minutes, until a tester comes out clean.  Feel free to underbake them a bit.</li><li>Once brownies are cooled, spread ganache.</li><li>I like to put them in the refrigerator to firm up the ganache.</li><li>To make the ganache, bring the heavy cream and peppercorns to a simmer in a small pot.</li><li>Strain the peppercorns and stir in semisweet chocolate chips.</li></ol>",
