    "summary": "Cherry Blueberry Muffins might be just the morn meal you are searching for. One serving contains <b>168 calories</b>, <b>6g of protein</b>, and <b>7g of fat</b>. For <b>68 cents per serving</b>, this recipe <b>covers 5%</b> of your daily requirements of vitamins and minerals. 48 people were impressed by this recipe. It is a good option if you're following a <b>vegetarian</b> diet. If you have unbleached flour, almond flour, sugar, and a few other ingredients on hand, you can make it. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 41%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/cherry-and-blueberry-muffins-497142\">Cherry and Blueberry Muffins</a>, <a href=\"https://spoonacular.com/recipes/otis-spunkmeyer-blueberry-muffins-whats-better-than-fresh-blueberry-muffins-600451\">Otis Spunkmeyer Blueberry Muffins – what’s better than fresh blueberry muffins</a>, and <a href=\"https://spoonacular.com/recipes/amazingly-blueberry-ey-blueberry-muffins-510119\">Amazingly Blueberry-ey Blueberry Muffins</a> for similar recipes.",
