    "imageType": "jpg",
    "summary": "Roasted Cabbage Wedge Salad with Yogurt Gorgonzola Dressing might be just the main course you are searching for. One serving contains <b>187 calories</b>, <b>12g of protein</b>, and <b>11g of fat</b>. This gluten free recipe serves 4 and costs <b>$1.3 per serving</b>. Several people made this recipe, and 550 would say it hit the spot. If you have bacon, scallions, gorgonzola, and a few other ingredients on hand, you can make it. To use up the grapeseed oil you could follow this main course with the <a href=\"https://spoonacular.com/recipes/strawberry-crumble-552593\">Strawberry Crumble</a> as a dessert. From preparation to the plate, this recipe takes around <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 70%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/iceberg-wedge-salad-with-creamy-gorgonzola-dressing-392199\">Iceberg Wedge Salad with Creamy Gorgonzola Dressing</a>, <a href=\"https://spoonacular.com/recipes/southwestern-wedge-salad-with-green-chile-yogurt-dressing-628400\">Southwestern Wedge Salad with Green Chile Yogurt Dressing</a>, and <a href=\"https://spoonacular.com/recipes/roasted-cabbage-wedge-salad-566060\">Roasted Cabbage Wedge Salad</a> for similar recipes.",
