    "summary": "Vegetarian Mushroom Shepherd's Pie could be just the <b>gluten free and dairy free</b> recipe you've been looking for. This recipe serves 12 and costs $1.2 per serving. One serving contains <b>124 calories</b>, <b>6g of protein</b>, and <b>6g of fat</b>. If you have bell pepper, soy granules, thyme, and a few other ingredients on hand, you can make it. This recipe is liked by 9 foodies and cooks. This recipe is typical of European cuisine. It is brought to you by Foodista. From preparation to the plate, this recipe takes roughly <b>roughly 45 minutes</b>. Overall, this recipe earns a <b>super spoonacular score of 83%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/vegetarian-mushroom-shepherds-pie-with-vegan-version-122196\">Vegetarian Mushroom Shepherd's Pie - With Vegan Version</a>, <a href=\"https://spoonacular.com/recipes/curried-vegetarian-shepherds-pie-with-portobello-mushroom-sauce-622711\">Curried Vegetarian Shepherd's Pie with Portobello Mushroom Sauce</a>, and <a href=\"https://spoonacular.com/recipes/vegetarian-shepherds-pie-71447\">Vegetarian Shepherd's Pie</a>.",
