    "summary": "The recipe Captain America Shield Cookies can be made <b>in roughly roughly 45 minutes</b>. This recipe serves 12. One serving contains <b>179 calories</b>, <b>1g of protein</b>, and <b>7g of fat</b>. For <b>65 cents per serving</b>, this recipe <b>covers 2%</b> of your daily requirements of vitamins and minerals. Only a few people made this recipe, and 6 would say it hit the spot. It works well as a dessert. A mixture of circular cookie cutters, star cookie cutter, coconut oil, and a handful of other ingredients are all it takes to make this recipe so tasty. It is a good option if you're following a <b>dairy free</b> diet. It is brought to you by Pink When. Taking all factors into account, this recipe <b>earns a spoonacular score of 81%</b>, which is excellent. Try <a href=\"https://spoonacular.com/recipes/captain-america-m-m-sugar-cookies-612431\">Captain America M&M Sugar Cookies</a>, <a href=\"https://spoonacular.com/recipes/americas-test-kitchen-chocolate-chip-cookies-626421\">America's Test Kitchen Chocolate Chip Cookies</a>, and <a href=\"https://spoonacular.com/recipes/pb-america-602899\">PB & America</a> for similar recipes.",
