    "summary": "If you have roughly <b>roughly 45 minutes</b> to spend in the kitchen, Kale & chickpea stew with cumin, smoked paprikan and lime might be an amazing <b>gluten free and lacto ovo vegetarian</b> recipe to try. One portion of this dish contains about <b>4g of protein</b>, <b>5g of fat</b>, and a total of <b>162 calories</b>. For <b>69 cents per serving</b>, you get a soup that serves 6. 15 people were glad they tried this recipe. It is brought to you by Foodista. <b>Autumn</b> will be even more special with this recipe. A mixture of 2 a bunch of kale, beer, olive oil, and a handful of other ingredients are all it takes to make this recipe so scrumptious. Overall, this recipe earns a <b>solid spoonacular score of 57%</b>. Similar recipes include <a href=\"https://spoonacular.com/recipes/mexican-black-bean-salad-with-cumin-lime-and-smoked-paprika-dressing-vegan-628029\">Mexican Black Bean Salad with Cumin, Lime and Smoked Paprika dressing {vegan}</a>, <a href=\"https://spoonacular.com/recipes/one-pot-cumin-smoked-paprika-chicken-with-potatoes-584593\">One-Pot Cumin & Smoked Paprika Chicken with Potatoes</a>, and <a href=\"https://spoonacular.com/recipes/moorish-style-salad-with-cumin-and-smoked-paprika-ensalada-morisca-747\">Moorish-Style Salad with Cumin and Smoked Paprika (Ensalada Morisca)</a>.",
