    "instructions": "<ol><li>Preheat oven to 150C.</li><li>Pour fresh milk and whipping cream into a sauce pot. Slice the vanilla pod and scrape the seeds into the cream. Chop the empty pod into small pieces, and add to the cream too.</li><li>Bring the cream mixture to boiling point, then lower the heat and simmer gently for 3 minutes.</li><li>Lightly beat the sugar and eggs together in a large bowl until pale and smooth.</li><li>Strain the cream mixture through a fine sieve and bring back to boil. Gradually add the cream to the eggs while whisking vigorously. This will temper the eggs so that they do not curdle. Once all of the the cream has been added into the eggs, strain again and pour the mixture into 7-8 ramekins depending on size.</li><li>Put the ramekins in a large cake pan or roasting pan and pour in enough hot water to come halfway up the sides of the ramekins.</li><li>Cook on the centre shelf for about 30-40 minutes, or until the custards are just set and still a bit wobbly in the middle. Remove the ramekins from the water and allow to cool to room temperature and refrigerate for at least 3 hours or till next day.</li><li>Before ready to serve, sprinkle some caster sugar evenly over the custard, then caramelise with a blowtorch.</li></ol>",
