    "summary": "You can never have too many main course recipes, so give Lamb Burgers With Tzatziki Sauce a try. For <b>$3.6 per serving</b>, this recipe <b>covers 28%</b> of your daily requirements of vitamins and minerals. One serving contains <b>614 calories</b>, <b>38g of protein</b>, and <b>37g of fat</b>. A few people made this recipe, and 12 would say it hit the spot. A mixture of dill, greek yogurt, kosher salt & pepper, and a handful of other ingredients are all it takes to make this recipe so delicious. To use up the juice of lemon you could follow this main course with the <a href=\"https://spoonacular.com/recipes/fruit-juice-pops-433326\">Fruit Juice Pops</a> as a dessert. This recipe is typical of Mediterranean cuisine. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 79%</b>. This score is solid. Try <a href=\"https://spoonacular.com/recipes/greek-lamb-burgers-with-tzatziki-sauce-888153\">Greek Lamb Burgers with Tzatziki Sauce</a>, <a href=\"https://spoonacular.com/recipes/lamb-burgers-with-tzatziki-sauce-and-parsley-salad-98147\">Lamb Burgers with Tzatziki Sauce and Parsley Salad</a>, and <a href=\"https://spoonacular.com/recipes/lamb-burgers-with-tzatziki-221403\">Lamb burgers with tzatziki</a> for similar recipes.",
