    "instructions": "<ol><li>Cut the fillet into four to five smaller pieces.</li><li>Mix and combine breadcrumbs, Parmesan and parsley in a shallow dish and season with salt and pepper.</li><li>Dip the chicken pieces into the beaten egg, then into the breadcrumb mixture.</li><li>Place in a single layer on a small baking sheet and chill in the refrigerator for at least 30 minutes or even overnight.</li><li>Meanwhile, make the garlic mayonnaise. Mix and combine all ingredients. Cover and chill until ready to serve.</li><li>Drizzle the butter over chicken pieces and cook in the oven at 180C for about 20 minutes, until crisp and golden.</li><li>Serve immediately with the garlic mayonnaise and green salad.</li><li>Easy suggestion: alternatively, cool the chicken, store in the refrigerator until required, and then serve at the room temperature with the garlic mayonnaise. Ideal for picnics.</li></ol>",
