    "occasions": [ ],
    "instructions": "<ol><li>Allow the puff pastry dough to thaw, according to the package directions.</li><li>Lightly flour a flat work surface.</li><li>Place one sheet of the dough on top of the other on the floured surface, and gently roll it out to a 9x12-inch shape that is about 1/4-inch thick. (You could use each sheet of dough individually, if you prefer.)</li><li>Spread the olive tapenade over the dough, followed by the crumbled goat cheese. Top with the toasted pine nuts.</li><li>Start by rolling the short ends of the dough toward each other until the meet in the middle.</li><li>Tightly wrap the rolled dough in plastic wrap and refrigerate for about 30 minutes.</li><li>Preheat your oven to 425 degrees F.</li><li>Line a baking sheet with parchment or a silicone baking mat.</li><li>Unwrap the dough and use a serrated knife to slice the rolled dough into 1/4-inch slices, and put them on the baking sheet about 2 inches apart.</li><li>Sprinkle the tops with the coarse salt and bake for 12-14 minutes, or until they are just lightly golden.</li><li>Serve warm</li></ol>",
