    "summary": "Meatball Sliders might be just the hor d'oeuvre you are searching for. This recipe serves 20 and costs $1.35 per serving. One serving contains <b>357 calories</b>, <b>18g of protein</b>, and <b>16g of fat</b>. A mixture of olive oil, coarse bread crumbs, parmesan, and a handful of other ingredients are all it takes to make this recipe so delicious. A few people made this recipe, and 12 would say it hit the spot. From preparation to the plate, this recipe takes about <b>45 minutes</b>. All things considered, we decided this recipe <b>deserves a spoonacular score of 57%</b>. This score is good. Similar recipes include <a href=\"https://spoonacular.com/recipes/meatball-sliders-620383\">Meatball Sliders</a>, <a href=\"https://spoonacular.com/recipes/meatball-sliders-522355\">Meatball sliders</a>, and <a href=\"https://spoonacular.com/recipes/meatball-sliders-476889\">Meatball Sliders</a>.",
