    "summary": "For <b>$1.28 per serving</b>, this recipe <b>covers 24%</b> of your daily requirements of vitamins and minerals. This recipe makes 10 servings with <b>489 calories</b>, <b>17g of protein</b>, and <b>38g of fat</b> each. This recipe is liked by 84 foodies and cooks. Head to the store and pick up peanuts, cocoa, cream, and a few other things to make it today. From preparation to the plate, this recipe takes around <b>45 minutes</b>. It is a good option if you're following a <b>gluten free and vegetarian</b> diet. All things considered, we decided this recipe <b>deserves a spoonacular score of 75%</b>. This score is good. Try <a href=\"https://spoonacular.com/recipes/slow-cooker-caramel-peanut-butter-hot-fudge-cake-616710\">Slow Cooker Caramel Peanut Butter Hot Fudge Cake</a>, <a href=\"https://spoonacular.com/recipes/caramel-peanut-butter-fudge-573829\">Caramel Peanut Butter Fudge</a>, and <a href=\"https://spoonacular.com/recipes/peanut-butter-caramel-pretzel-crunch-fudge-35079\">Peanut Butter & Caramel Pretzel Crunch Fudge</a> for similar recipes.",
