    "summary": "Need a <b>lacto ovo vegetarian dessert</b>? Authentic Mexican Wedding Cookies could be an awesome recipe to try. This recipe makes 48 servings with <b>87 calories</b>, <b>1g of protein</b>, and <b>5g of fat</b> each. For <b>14 cents per serving</b>, this recipe <b>covers 1%</b> of your daily requirements of vitamins and minerals. Head to the store and pick up ground cinnamon, pecans, all purpose flour, and a few other things to make it today. This recipe is liked by 8 foodies and cooks. It will be a hit at your <b>Wedding</b> event. It is a <b>very reasonably priced</b> recipe for fans of Mexican food. From preparation to the plate, this recipe takes approximately <b>approximately 45 minutes</b>. It is brought to you by Foodista. Overall, this recipe earns an <b>improvable spoonacular score of 3%</b>. Similar recipes are <a href=\"https://spoonacular.com/recipes/mexican-wedding-cookies-1056263\">Mexican Wedding Cookies</a>, <a href=\"https://spoonacular.com/recipes/mexican-wedding-cookies-707671\">Mexican Wedding Cookies</a>, and <a href=\"https://spoonacular.com/recipes/mexican-wedding-cookies-484015\">Mexican Wedding Cookies</a>.",
