    "summary": "Roasted Pumpkin and Barley Risotto takes about <b>1 hour and 15 minutes</b> from beginning to end. This main course has <b>419 calories</b>, <b>18g of protein</b>, and <b>9g of fat</b> per serving. For <b>$2.05 per serving</b>, this recipe <b>covers 28%</b> of your daily requirements of vitamins and minerals. This recipe serves 3. A mixture of ginger, garlic, oregano, and a handful of other ingredients are all it takes to make this recipe so tasty. 7 people have made this recipe and would make it again. This recipe is typical of Mediterranean cuisine. It is brought to you by Foodista. Taking all factors into account, this recipe <b>earns a spoonacular score of 82%</b>, which is excellent. Users who liked this recipe also liked <a href=\"https://spoonacular.com/recipes/barley-risotto-with-roasted-winter-vegetables-250205\">Barley Risotto with Roasted Winter Vegetables</a>, <a href=\"https://spoonacular.com/recipes/barley-risotto-with-roasted-winter-vegetables-545512\">Barley Risotto with Roasted Winter Vegetables</a>, and <a href=\"https://spoonacular.com/recipes/barley-risotto-with-roasted-winter-vegetables-942844\">Barley Risotto with Roasted Winter Vegetables</a>.",
